insert into bar (id, name, description, direction, owner, images, created_at) values ( c2dde920-80df-4743-86d4-3545269edcb7, "Casa Ruperto", "Este clásico bar trianero lleva desde 1970 sirviendo codornices fritas y adobadas y son los 'pajaritos' más celebrados de toda Sevilla. Todo aquel que para en este singular templo de las codornices se va encantado tanto por calidad de la comida como por la simpatía y el buen ambiente que se vive en Casa Ruperto.", "Avenida Santa Cecilia, 2", , "", );
insert into bar (id, name, description, direction, owner, images, created_at) values ( db1ac247-571a-43cf-82ce-411728783c07, "Bar Casa Casimiro ", "Tienen una carta amplia en las que se incluye: croquetas, huevos de chocos, flamenquín, solomillo al whisky, filete de pollo bechamel, entre otras.", "Avenida de Coria, 19", , "", );
insert into bar (id, name, description, direction, owner, images, created_at) values ( 464f01c6-7f8b-4afb-b9ba-44fdf9db9631, "Trianilla", "Su amplia carta tiene manjares tales como: ensaladilla de pulpo, coca de gorgonzola, dados de atún rojo sobre pan, puntas de solomillo ibérico y hamburguesa de ternera black angus, entre otros platos.", "C/Manuel Pareja Obregón, 2", , "", );
insert into bar (id, name, description, direction, owner, images, created_at) values ( ae6d3c89-07ae-4e73-ad79-97148ca40158, "Bar Salomón Rey de los Pinchitos", "Aquí la especialidad de la casa son los pinchitos, como su nombre bien indica. Hay tapas y raciones para degustar tanto en el salón como en la terraza. Además de los pinchitos tienen gran fama las patatas bravas, la ensaladilla, el calabacín relleno, zanahorias aliñadas, solomillo de atún mechado o los mejillones en escabeche de las rías bajas.", "López de Gómara, 11", , "", );
insert into bar (id, name, description, direction, owner, images, created_at) values ( 625cd031-1a54-4d3d-a6bc-b835909fa18e, "Café Bar Altozano de Triana", "Es de los bares clásicos del barrio y su comida más clásica todavía. Destaca sin duda por sus tortillitas de camarones, el adobo y las coquinas. Es imposible que este bar defraude a alguien. Además tiene un no sé qué especial que hace que te sientas trianero. Por no hablar de sus bajos precios.", "C/San Jacinto, 4", , "", );
insert into bar (id, name, description, direction, owner, images, created_at) values ( 3bb95209-da68-4f55-9eed-ba0001a1ad3c, "Blanca Paloma", "De los mejores lugares trianeros con diferencia. No es baratísimo pero merece mucho la pena por algunas de las exquisiteces que puedes tomar. Además dentro de la comida clásica suelen ser innovadores.", "C/San Jacinto, 49", , "", );
insert into bar (id, name, description, direction, owner, images, created_at) values ( bf260a9b-3438-4067-b3d2-030b782b1388, "Victoria 8", "Lugar recomendadísimo en todos los sentidos. El local está bien decorado y es acogedor. No hay una gran variedad pero eso es lo de menos, porque lo compensa con creces sus tataki de atún y sus croquetas de rabo de toro.", "C/Victoria, 8", , "", );
insert into bar (id, name, description, direction, owner, images, created_at) values ( 9f26b992-027b-4290-8851-34bc5c40e36f, "Sol y sombra", "Otro tipiquísimo lugar del barrio de los que huelen a queso curado y jamón. Hay una gran variedad de tapas y de precio es más que correcto.", "C/Castilla, 151", , "", );
insert into bar (id, name, description, direction, owner, images, created_at) values ( 7055f932-a1ea-4fe7-a4b2-0da9a871f644, "Vega 10", "El macarrón toro, las arepas y la pastela son algunas de las mejores comidas del lugar, por no hablar de los postres. Dejad un hueco (aunque sea complicado) para el cremoso de azafrán.", "C/Vega, 10", , "", );
insert into bar (id, name, description, direction, owner, images, created_at) values ( a7b81431-43a1-4e72-8685-3647f12b3047, "Maria Trifulca", "Aunque solo sea por sus espectaculares vistas, bien merece la pena incluirlo en esta lista. Ubicado en el antiguo faro de Triana, Maria Trifulca es una comida de lujo sobre el Guadalquivir y la opción perfecta para ocasiones especiales.", "Puente de Triana, Plaza del Altozado, esquina", , "", );
insert into bar (id, name, description, direction, owner, images, created_at) values ( bf7c2b27-6396-4abf-8eed-b93933290621, "Taberna Miami", "Una taberna donde comer en Triana de tapas o de raciones sentado en su terraza. No te pierdas el adobo, las acedías o el secreto. También recomiendan las bandejas de pescaito frito, el rabo de toro y el arroz negro.", "C/San Jacinto, 21", , "", );
insert into bar (id, name, description, direction, owner, images, created_at) values ( e0469d55-f941-44d0-93ae-1ffed49d300c, "Casa Diego", "Una tasca tradicional de las más típicas y uno de los mejores bares de tapas en Triana. Comida casera, con buenas raciones y de calidad.", "C/Calle Alfarería, 5", , "", );
insert into bar (id, name, description, direction, owner, images, created_at) values ( 912b2cb8-389f-408a-889d-95ea65250e67, "Patio de San Eloy", "Un lugar emblemático donde tomar algo, también imprescindible en el top ten de bares y restaurantes donde comer de tapas en Triana bien y barato.", "C/San Jacinto, 16", , "", );
insert into bar (id, name, description, direction, owner, images, created_at) values ( a8046137-373a-40a7-85f3-8d5f241bbceb, "Freiduría Reina Victoria", "Incluimos esta freiduría entre las recomendaciones para comer de tapas en Triana bien y barato, tal y como nos la dieron. Aunque tienen una pequeña sala para comer, en realidad el local es muy pequeño y lo ideal es coger la comida para llevar.", "C/Rodrigo de Triana, 51", , "", );
